import Nav from "./Nav";

const Header = () => {
  return (
    <div className="header">
      <div className="logo">Yusuf Haji</div>
      <div className="nav">
        <nav>
          <Link to="/about">
            <a href="">About</a>
          </Link>
          <a href="">Contact</a>
        </nav>
      </div>
      <div className="console">
        <button className="dark-mode">Dark Mode</button>
      </div>
    </div>
  );
};

export default Header;
